import "./App.css";
import { Navbar } from "./Navbar";
import { Pill } from "./Pill";

import AthelasLogo from "./assets/athelas.jpeg";
import { WorkEntry } from "./WorkEntry";

export function Work() {
  return (
    <div
      style={{ maxWidth: 450, margin: "0% auto", padding: 16, fontSize: 14 }}
    >
      <Navbar />

      <WorkEntry
        logo={AthelasLogo}
        title={"Athelas"}
        tags={["Growth Engineer", "Healthcare"]}
        description="img elements must have an alt prop, either with meaningful text, or an empty string for decorative images   "
      />

      <WorkEntry
        logo={AthelasLogo}
        title={"Nextdoor"}
        tags={["Software", "Community"]}
        description="img elements must have an alt prop, either with meaningful text, or an empty string for decorative images   "
      />

      <WorkEntry
        logo={AthelasLogo}
        title={"Cal Hacks"}
        tags={["Executive Director", "Hackathon"]}
        description="img elements must have an alt prop, either with meaningful text, or an empty string for decorative images   "
      />
    </div>
  );
}
